import React, { useState } from "react";

import {
  MDBCard,
  MDBCardImage,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBRow,
  MDBCol,
  MDBContainer,
  MDBTypography,
  MDBAnimation,
} from "mdb-react-ui-kit";

export default function DavidR() {
  return (
    <MDBContainer style={{}} fluid>
      <MDBTypography
        variant="h1"
        className="text-center"
        style={{ fontWeight: "bold" }}
      >
        David Restrepo
      </MDBTypography>
      </MDBContainer>
  )
}
